import { useEffect } from "react";

function ErrorPage() {

    useEffect(() => {
        document.title = '404';
    }, []);

    return (
    <div className="error-bg-color">
        <div class="p-5 mb-4 error-bg">
        <div class="container-fluid py-5">
            <h1 class="display-5 fw-bold text-white mt-5">Custom jumbotron</h1>
            <p class="col-md-8 fs-4 text-white">Using a series of utilities, you can create this jumbotron, just like the one in previous versions of Bootstrap. Check out the examples below for how you can remix and restyle it to your liking.</p>
            <button class="btn btn-primary btn-lg" type="button">Example button</button>
        </div>
    </div>
    </div>
    )
}

export default ErrorPage;
